import React, { Component } from 'react';
import LoginComponent from './components/todo/LoginComponent';

class TodoApp extends React.Component {
    render() {
        return (
            <div className="TodoApp">
                <LoginComponent />
            </div>
        );
    }
}



export default TodoApp;
